import React from 'react';
import AuthForm from './AuthForm';
import Header from './Header'

function Register({ onSignUp, redirectToLogin, handleRegister }) {

    function handleSubmit(formParams) {
        // e.preventDefault();

        let { email, password } = formParams;
        debugger
        handleRegister({ email, password }).catch(err => {
            console.log('Ошибка регистрации', err)
        });
    }

    return (
        <>
            <Header title={'Войти'} handleClick={redirectToLogin} />
            <AuthForm title={'Регистрация'} onSubmit={handleSubmit} buttonTitle={'Зарегистрироваться'} />
            <p className="header__text" >Уже зарегистрированы? <a className="header__text" href="#" onClick={redirectToLogin}>Войти</a></p>
        </>
    );
}

export default Register;
